import{_ as e,c as t,o as a,a as s}from"./app.40278fc7.js";const o="/phpstorm/assets/search-live-templates.94b8b160.png",l="/phpstorm/assets/live-templates.ba295278.png",c="/phpstorm/assets/create-new-function-use-pubf-live-template.1ed567a7.gif",i="/phpstorm/assets/create-template-group.ca6cef4e.png",p="/phpstorm/assets/custom-template-group-name.fb15c12e.png",d="/phpstorm/assets/edit-template-variables.64cb9fa3.png",r="/phpstorm/assets/create-new-live-template.77fa5315.png",m="/phpstorm/assets/apply-custom-live-template.1b9913af.gif",P=JSON.parse('{"title":"\u4EE3\u7801\u7247\u6BB5","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u81EA\u5B9A\u4E49\u4EE3\u7801\u7247\u6BB5","slug":"\u81EA\u5B9A\u4E49\u4EE3\u7801\u7247\u6BB5","link":"#\u81EA\u5B9A\u4E49\u4EE3\u7801\u7247\u6BB5","children":[{"level":3,"title":"\u65B0\u5EFA Template Group","slug":"\u65B0\u5EFA-template-group","link":"#\u65B0\u5EFA-template-group","children":[]},{"level":3,"title":"\u65B0\u5EFA\u4EE3\u7801\u7247\u6BB5","slug":"\u65B0\u5EFA\u4EE3\u7801\u7247\u6BB5","link":"#\u65B0\u5EFA\u4EE3\u7801\u7247\u6BB5","children":[]},{"level":3,"title":"\u4F7F\u7528\u81EA\u5B9A\u4EE5\u4EE3\u7801\u7247\u6BB5","slug":"\u4F7F\u7528\u81EA\u5B9A\u4EE5\u4EE3\u7801\u7247\u6BB5","link":"#\u4F7F\u7528\u81EA\u5B9A\u4EE5\u4EE3\u7801\u7247\u6BB5","children":[]}]}],"relativePath":"guide/live-templates.md","lastUpdated":1662462726000}'),n={name:"guide/live-templates.md"},u=s('<h1 id="\u4EE3\u7801\u7247\u6BB5" tabindex="-1">\u4EE3\u7801\u7247\u6BB5 <a class="header-anchor" href="#\u4EE3\u7801\u7247\u6BB5" aria-hidden="true">#</a></h1><p>PhpStorm \u652F\u6301\u901A\u8FC7 <code>Live Templates</code> \u529F\u80FD\u5728\u7F16\u5199\u5177\u4F53\u4E1A\u52A1\u4EE3\u7801\u65F6\u5FEB\u901F\u751F\u6210\u6A21\u677F\u4EE3\u7801\uFF0C\u6BD4\u5982\u63A7\u5236\u7ED3\u6784\u3001\u5F02\u5E38\u6355\u83B7\u3001\u5916\u90E8\u9759\u6001\u8D44\u6E90\u7684\u5F15\u7528\u3001Vue \u7EC4\u4EF6\u6A21\u5757\u7B49\u3002</p><p>\u4E0B\u9762\u4EE5\u7CFB\u7EDF\u9ED8\u8BA4\u7684 <code>pubf</code> \u4EE3\u7801\u7247\u6BB5\u4E3A\u4F8B\uFF1A</p><ul><li><p>\u5728 PhpStorm \u7684 <code>Preferences</code> \u504F\u597D\u8BBE\u7F6E\u4E2D\u9009\u62E9 <code>Editor</code> -&gt; <code>Live Templates</code></p></li><li><p>\u6216\u8005\u901A\u8FC7\u5FEB\u6377\u952E <code>Command + Shift + A</code> \u547C\u51FA <code>Action</code> \u5BFC\u822A\u754C\u9762\uFF0C\u5728\u8F93\u5165\u6846\u8F93\u5165 <code>live templates</code>\uFF0C\u5728\u4E0B\u62C9\u5217\u8868\u4E2D\u9009\u4E2D <code>Live Templates</code>\uFF1A</p><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u5C55\u793A\u4E0E\u9690\u85CF</summary><p><img src="'+o+'" alt=""></p></details></li></ul><p>\u8FDB\u5165\u6587\u4EF6\u4EE3\u7801\u7247\u6BB5\u754C\u9762\uFF0C\u5728\u8FD9\u91CC\u53EF\u4EE5\u770B\u5230 PhpStorm \u5185\u7F6E\u652F\u6301\u7684\u6240\u6709\u8BED\u8A00\u7684\u4EE3\u7801\u7247\u6BB5\uFF1A</p><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u5C55\u793A\u4E0E\u9690\u85CF</summary><p><img src="'+l+'" alt=""></p></details><p>\u53EF\u4EE5\u5728 PHP \u7C7B\u6216 Trait \u6587\u4EF6\u4E2D\u901A\u8FC7 <code>pubf</code> \u7136\u540E\u8F93\u5165 <code>Tab</code> \u952E\uFF08\u6216\u8005\u5728\u952E\u5165\u7684\u5730\u65B9\u9009\u62E9\u4E0B\u62C9\u6846\u4E2D\u7B2C\u4E00\u4E2A\u5217\u51FA\u7684\u4EE3\u7801\u63D0\u793A\u6309\u56DE\u8F66\u786E\u8BA4\uFF09\u5E76\u4F7F\u7528 <code>Tab</code> \u6309\u952E\u5C06\u5149\u6807\u79FB\u52A8\u5230\u4E0B\u4E00\u4E2A\u4F4D\u7F6E\uFF0C\u6765\u5FEB\u901F\u751F\u6210 <code>public function</code> \u51FD\u6570\u6A21\u677F\u4EE3\u7801\u3002</p><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u5C55\u793A\u4E0E\u9690\u85CF</summary><p><img src="'+c+'" alt=""></p></details><h2 id="\u81EA\u5B9A\u4E49\u4EE3\u7801\u7247\u6BB5" tabindex="-1">\u81EA\u5B9A\u4E49\u4EE3\u7801\u7247\u6BB5 <a class="header-anchor" href="#\u81EA\u5B9A\u4E49\u4EE3\u7801\u7247\u6BB5" aria-hidden="true">#</a></h2><h3 id="\u65B0\u5EFA-template-group" tabindex="-1">\u65B0\u5EFA <code>Template Group</code> <a class="header-anchor" href="#\u65B0\u5EFA-template-group" aria-hidden="true">#</a></h3><blockquote><p><strong>\u6CE8\u610F\uFF1A</strong> \u8FD9\u4E00\u6B65\u4E0D\u662F\u5FC5\u987B\u7684\uFF0C\u4E3A\u4E86\u540E\u671F\u65B9\u4FBF\u7BA1\u7406\uFF0C\u5C06\u6240\u6709\u81EA\u5B9A\u4E49\u7684\u4EE3\u7801\u7247\u6BB5\u90FD\u653E\u5728\u8FD9\u4E2A\u65B0\u5EFA\u7684\u5206\u7EC4\u4E0B\u3002</p></blockquote><p>\u70B9\u51FB\u53F3\u4FA7\u7684 <code>+</code> \u6216\u8005\u4F7F\u7528\u5FEB\u6377\u952E <code>Command + N</code>\uFF0C\u5728\u5F39\u51FA\u7684\u4E0B\u62C9\u9009\u9879\u4E2D\u9009\u62E9 <code>2. Template Group...</code></p><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u5C55\u793A\u4E0E\u9690\u85CF</summary><p><img src="'+i+'" alt=""></p></details><p>\u5728\u63A5\u4E0B\u6765\u7684\u5F39\u51FA\u5C42\u4E2D\u8F93\u5165\u81EA\u5B9A\u4E49\u7684\u4EE3\u7801\u7247\u6BB5\u5206\u7EC4\u540D\u79F0 <code>Custom</code>\u3002</p><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u5C55\u793A\u4E0E\u9690\u85CF</summary><p><img src="'+p+'" alt=""></p></details><p>\u5982\u679C\u540E\u7EED\u9700\u8981\u6DFB\u52A0\u7684\u81EA\u5B9A\u4E49\u4EE3\u7801\u7247\u6BB5\u653E\u5728\u81EA\u5B9A\u4E49\u7684\u4EE3\u7801\u7247\u6BB5\u5206\u7EC4 Custom \u4E2D\u3002</p><h3 id="\u65B0\u5EFA\u4EE3\u7801\u7247\u6BB5" tabindex="-1">\u65B0\u5EFA\u4EE3\u7801\u7247\u6BB5 <a class="header-anchor" href="#\u65B0\u5EFA\u4EE3\u7801\u7247\u6BB5" aria-hidden="true">#</a></h3><p>\u4F7F\u7528\u5FEB\u6377\u952E <code>Command + N</code> \u5728\u81EA\u5B9A\u4E49\u5206\u7EC4\u65B0\u5EFA\u4EE3\u7801\u7247\u6BB5\uFF0C\u5728\u8F93\u5165\u8868\u5355\u4E2D\u63D0\u4F9B\u5982\u4E0B\u503C\uFF1A</p><ul><li><ol><li>Abbreviation: \u4EE3\u7801\u7247\u6BB5\u7F29\u5199\uFF0C\u901A\u8FC7\u8FD9\u4E2A\u7F29\u5199\u53EF\u4EE5\u547C\u51FA\u5B9A\u4E49\u7684\u4EE3\u7801\u7247\u6BB5\u5185\u5BB9</li></ol></li><li><ol start="2"><li>Description: \u4EE3\u7801\u7247\u6BB5\u63CF\u8FF0</li></ol></li><li><ol start="3"><li>Template Text: \u4EE3\u7801\u7247\u6BB5\u5177\u4F53\u5185\u5BB9</li></ol><p>\u6A21\u677F\u4EE3\u7801\u4E2D\u5B9A\u4E49\u4E86\u4E00\u4E9B\u53D8\u91CF\uFF08\u901A\u8FC7 <code>$\u53D8\u91CF\u540D$</code> \u5B9A\u4E49\uFF09\uFF0C\u4EE5\u4FBF\u4E3A\u4E0D\u540C\u7684\u6587\u672C\u8F93\u5165\u6846\u5B9A\u4E49\u5BF9\u5E94\u7684\u5C5E\u6027\u548C\u6587\u672C\u3002</p></li><li><ol start="4"><li>Change \u9009\u9879: \u9009\u62E9\u4EE3\u7801\u7247\u6BB5\u7684\u5E94\u7528\u4E0A\u4E0B\u6587\u73AF\u5883\uFF0C\u6BD4\u5982\u6709\u7684\u4EE3\u7801\u7247\u6BB5\u662F\u5728 HTML \u4E2D\u4F7F\u7528\uFF0C\u6709\u7684\u4EE3\u7801\u7247\u6BB5\u4EC5\u5728 PHP \u6587\u4EF6\u4E2D\u4F7F\u7528\uFF0C\u9ED8\u8BA4\u4E0D\u9009\u62E9\u4E0A\u4E0B\u6587\u7684\u4EE3\u7801\u7247\u6BB5\u4E0D\u4F1A\u751F\u6548</li></ol></li><li><ol start="5"><li>\u7F16\u8F91\u53D8\u91CF</li></ol><p>\u53EF\u4EE5\u70B9\u51FB\u8FD9\u4E2A\u6309\u94AE\u5BF9\u5B9A\u4E49\u7684\u53D8\u91CF\u8FDB\u884C\u4E00\u4E9B\u914D\u7F6E\uFF0C\u6BD4\u5982\u5BF9 <code>$LABEL$</code> \u53D8\u91CF\u4F7F\u7528\u8868\u8FBE\u5F0F <code>capitalize</code>\u5904\u7406 <code>$NAME$</code> \u53D8\u91CF\uFF0C\u8868\u793A\u5C06 <code>NAME</code> \u53D8\u91CF\u503C\u9996\u5B57\u6BCD\u5927\u5199\u4E3A <code>LABEL</code> \u53D8\u91CF\u8D4B\u503C</p><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u5C55\u793A\u4E0E\u9690\u85CF</summary><p><img src="'+d+'" alt=""></p></details></li><li><ol start="6"><li>\u786E\u8BA4\u4FDD\u5B58</li></ol></li></ul><details class="details custom-block"><summary>\u70B9\u51FB\u5207\u6362\u5C55\u793A\u4E0E\u9690\u85CF</summary><p><img src="'+r+'" alt=""></p></details><h3 id="\u4F7F\u7528\u81EA\u5B9A\u4EE5\u4EE3\u7801\u7247\u6BB5" tabindex="-1">\u4F7F\u7528\u81EA\u5B9A\u4EE5\u4EE3\u7801\u7247\u6BB5 <a class="header-anchor" href="#\u4F7F\u7528\u81EA\u5B9A\u4EE5\u4EE3\u7801\u7247\u6BB5" aria-hidden="true">#</a></h3><p>\u5728\u4EE3\u7801\u7F16\u8F91\u5668\u4E2D\u9009\u53D6\u4E00\u4E2A\u8868\u5355\u7247\u6BB5\uFF0C\u5C1D\u8BD5\u8F93\u5165 <code>tfield</code>\uFF0C\u7136\u540E\u70B9\u51FB <code>Tab</code> \u952E\u81EA\u52A8\u751F\u6210\u5BF9\u5E94\u6A21\u677F\u4EE3\u7801\uFF0C\u5728\u7EA2\u8272\u5149\u6807\u5904\u8F93\u5165 <code>name</code> \uFF0C\u53EF\u4EE5\u770B\u5230\u5176\u5B83\u53D8\u91CF\u4F4D\u7F6E\u90FD\u4F1A\u81EA\u52A8\u586B\u5145\u5BF9\u5E94\u7684\u5B57\u7B26\u4E32\u3002\u5982\u4E0B\uFF1A</p><p><img src="'+m+'" alt=""></p><p>\u5728\u65E5\u5E38\u4F7F\u7528 PhpStorm \u8FDB\u884C\u7F16\u7801\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u7075\u6D3B\u521B\u5EFA\u548C\u5B9A\u4E49\u4EE3\u7801\u6A21\u677F\u53EF\u4EE5\u6781\u5927\u63D0\u9AD8\u7F16\u7801\u6548\u7387\u3002</p>',24),h=[u];function _(g,b,f,v,T,k){return a(),t("div",null,h)}const A=e(n,[["render",_]]);export{P as __pageData,A as default};
